import React from 'react';
import './Articles.css';

function Articles() {
  const articlesData = [
    {
      heading: 'Article 1',
      location: 'Location 1',
      treesPlanted: 100,
      imageSrc: 'article1.jpg',
      details: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
    },
    {
      heading: 'Article 2',
      location: 'Location 2',
      treesPlanted: 200,
      imageSrc: 'article2.jpg',
      details: 'Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.',
    },
    {
      heading: 'Article 3',
      location: 'Location 3',
      treesPlanted: 300,
      imageSrc: 'article3.jpg',
      details: 'Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.',
    },
    {
      heading: 'Article 3',
      location: 'Location 3',
      treesPlanted: 300,
      imageSrc: 'article3.jpg',
      details: 'Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.',
    },
  ];

  return (
    <div className="articles">
      <h1 className='article-h1'>ARTICLES</h1>
      <div className="article-container">
        {articlesData.map((article, index) => (
          <div className="article" key={index}>
            <img src={article.imageSrc} alt={article.heading} />
            <h3>{article.heading}</h3>
            <p><strong>Location:</strong> {article.location}</p>
            <p><strong>Trees Planted:</strong> {article.treesPlanted}</p>
            <p>{article.details}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Articles;
